import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";

const Connect4 = () => {
    return (
        <Container fluid>
            <Row>
                <h1>This is the Connect 4 Project!</h1>
            </Row>
        </Container>   
    );
};

export default Connect4;
